import React from "react";
import { Container, List, Elements, Links } from "./NavBarStyle";
const NavBar = () => {
    return (
        <Container>
            <List>
                {<Elements>
                    <Links />
                </Elements>}.repeat(3)
            </List>
        </Container>
    );
};

export default NavBar;
